    def getSubject(self, page):
        subject_data['_PageNumNow'] = page
        response = self.requestPost(subject_url, subject_data)
        subject_list = re.findall("Select\('(.*?)\s*?','(.*?)\s*?'\)", response.text)
        ddlxueke.update({sub[0]: sub[1] for sub in subject_list})
        count = re.search('共\s*?(.*?)\s*?条', response.text)
        page_count = math.ceil(int(count[1]) / 15)
        if int(page_count) > page:
            return self.getSubject(page + 1)

    def getClasses(self, gradeId):
        classes_data['gradeId'] = gradeId
        response = self.requestPostJson(classes_url, classes_data)
        text = response.json()
        classes_list = re.findall("{id:'(.*?)_.*?',text:'(.*?)'}", text['d'])
        selClass.update({li[1]: li[0] for li in classes_list})

    def getClasses_s(self, class_str):
        grade_list = []
        class_list = []
        grade_name_list = []
        class_sp = class_str.split('，')
        for c in class_sp:
            if c[:-3] not in grade_name_list:
                grade_name_list.append(c[:-3])
            grade_id = ddlGrades.get(c[:-3])
            if grade_id not in grade_list:
                grade_list.append(grade_id)
            class_list.append(selClass.get(c))
        grade_list_str = ','.join(grade_list)
        class_list_str = ','.join(class_list)
        grade_name_list_str = ','.join(grade_name_list)
        return grade_list_str, class_list_str, grade_name_list_str

    def getClassex_sss(self):
        response = requests.get(SelectClass_url, headers=headers_Classex_sss)
        class_list = re.findall("Select\('(.*?)','(.*?)','.*?','(.*?)',", response.text)
        selClass.update({c[0] + c[1]: c[2] for c in class_list})
        count = re.search('共\s*?(.*?)\s*?条', response.text)
        page_count = math.ceil(int(count[1]) / 15)
        if int(page_count) > 1:
            vie = re.search('id="__VIEWSTATE" value="(.*?)"', response.text)
            eve = re.search('id="__EVENTVALIDATION" value="(.*?)"', response.text)
            vie = vie[1]
            eve = eve[1]
            return self.getClasses_next(2, page_count, vie, eve)

    def getClasses_next(self, page, page_count, vie, eve):
        data = {
            'ScriptManager1': 'UpdatePanel1|_PageNumNow' + str(page),
            '__EVENTTARGET': '_PageNumNow' + str(page),
            '__EVENTARGUMENT': '',
            '__LASTFOCUS': '',
            '__VIEWSTATE': vie,
            '__EVENTVALIDATION': eve,
            'pageIndexNow': '1',
            'ddlXiaoQu': '',
            'ddlGrade': "9c10912f-7b3b-48f1-8917-f8315481b2f0','e60fe341-76af-4d9d-a149-4001be714977','1edb3c7a-973c-4d76-a1f6-a67d8fb532ec','bf1ef79f-c1e4-4ba3-ade3-32a704438137','65ce5038-534e-47c9-aaa3-ba81eab03b29','858e333a-85f7-4831-af76-999707b2a874",
            'ddlWhere': '0',
            'txtSearch': '',
            'drpPageSize_zf': '15',
            'hfSelect': '',
            'hidStudentIds': '',
            '_PageNumNow': str(page),
            '_PageSizeNow': '15',
            'hidtype': 'njbj',
            '__ASYNCPOST': 'true'
        }
        response = requests.post(SelectClass_url, data=data, headers=headers_Classes_next)
        class_list = re.findall("Select\('(.*?)','(.*?)','.*?','(.*?)',", response.text)
        selClass.update({c[0] + c[1]: c[2] for c in class_list})
        page = int(page) + 1
        if page <= page_count:
            eve = re.search('id="__EVENTVALIDATION" value="(.*?)"', response.text)
            if eve:
                eve = eve[1]
            else:
                vie = re.search('__VIEWSTATE\|(.*?)\|', response.text)
                eve = re.search('__EVENTVALIDATION\|(.*?)\|', response.text)
                if eve:
                    vie = vie[1]
                    eve = eve[1]
            return self.getClasses_next(page, page_count, vie, eve)

    def read_data(self, path):
        data = xlrd.open_workbook(path)
        names = data.sheet_names()
        for name in names:
            table = data.sheet_by_name(name)
            row_count = table.nrows
            for i in range(1, row_count):
                itemObj = itemclass()
                itemObj.item['DropDownList1'] = table.cell_value(i, 1)
                itemObj.item['DropDownList2'] = table.cell_value(i, 2)
                itemObj.item['ddlDx'] = table.cell_value(i, 3)
                itemObj.item['ddlxueke'] = table.cell_value(i, 4)
                itemObj.item['hidSubName'] = table.cell_value(i, 4)
                itemObj.item['TextBox2'] = datetime(*xlrd.xldate_as_tuple(table.cell_value(i, 5), 0)).strftime(
                    '%Y-%m-%d')
                itemObj.item['ddltime2'] = table.cell_value(i, 6)
                itemObj.item['ddltim3'] = table.cell_value(i, 7)
                itemObj.item['ddlGrades'] = table.cell_value(i, 8)
                itemObj.item['selClass'] = table.cell_value(i, 9)
                itemObj.item['hidClassId'] = table.cell_value(i, 9)
                itemObj.item['hidClassName'] = table.cell_value(i, 9)
                itemObj.item['TextBox4'] = table.cell_value(i, 10)
                itemObj.item['txtTeacher'] = table.cell_value(i, 11)
                itemObj.item['hidem'] = table.cell_value(i, 11)
                itemObj.item['txtSyqc'] = table.cell_value(i, 12)
                itemObj.item['TextBox12'] = table.cell_value(i, 13)
                itemObj.item['TextBox11'] = table.cell_value(i, 14)
                yield itemObj.item

